import React, { useEffect, useState } from "react";
import axiosClient from "../api/axiosClient";

function Dashboard() {
  const [data, setData] = useState({});

  useEffect(() => {
    axiosClient
      .get("/admin/dashboard")
      .then((res) => setData(res.data));
  }, []);

  return (
    <div>
      <h1>Dashboard</h1>
      <p>Doanh thu: {data.totalRevenue}</p>
      <p>Số đơn hàng: {data.totalOrders}</p>
      <p>Số booking: {data.totalBookings}</p>
      <p>Nhân viên đang làm: {data.staffOnline}</p>
    </div>
  );
}

export default Dashboard;
